const MoviePref = () =>{
    return(
        <div className="p-5">
        <h1 className="text-white">pref</h1>
    
        <Form>
        <Form.Row>
          <Col>
            <Form.Control placeholder="First name" />
          </Col>
          <Col>
            <Form.Control placeholder="Last name" />
          </Col>
        </Form.Row>
      </Form>
      </div>
    );
};
export default MoviePref;
